import React from "react";
import { useHistory } from "react-router-dom";
import { Container, Button } from "@material-ui/core";

const Home = () => {
  const history = useHistory();
  return (
    <Container maxWidth="xs">
      <h1>Moodify</h1>
      <Button fullWidth onClick={() => history.push("/login")} style={{ backgroundColor: "ivory" }}>Login</Button>
      <Button fullWidth onClick={() => history.push("/signup")} color="primary">Signup</Button>
    </Container>
  )
}

export default Home;
